가격 괜찮네요 배송 보통이에요
한알먹고 출근하는데 에너지가 넘치는느낌임 ㅋㅋ ㅡㅡ;;
상세보기

배송 보통이에요 성능 성능이 뛰어나요 유통기한 기한이 넉넉해요
성능은 꾸준히 먹어봐야 알겠지만,  광고모델 이름값을 믿겠습니다. 다만 광고에는 개별 포장이라고 되어있는데 병으로 온 것에 대해 구체적인 표시를 안 해서 혼선이 됐네요. 전 개별 포장이라고 생각하고 구매했 거든요;;
상세보기

